import React from "react";
import { useNavigate } from "react-router-dom";  // Importing useNavigate

const Gadgets = () => {
  // Sample gadgets array with images
  const gadgets = [
    {
      id: 1,
      name: "Laptop",
      price: "$20/day",
      features: "8GB RAM, 512GB SSD",
      image: '/assets/laptop.png', // Path to image in public folder
    },
    {
      id: 2,
      name: "Camera",
      price: "$15/day",
      features: "DSLR, 4K Video",
      image: "/assets/camera.png", // Path to image in public folder
    },
    {
      id: 3,
      name: "Gaming Console",
      price: "$25/day",
      features: "PlayStation 5, Xbox Series X",
      image: "/assets/console.png", // Path to image in public folder
    },
    {
      id: 4,
      name: "GoPro",
      price: "$25/day",
      features: "4K Action Camera",
      image: "/assets/Gopro.png", // Path to image in public folder
    },
    {
      id: 5,
      name: "Microphone",
      price: "$15/day",
      features: "Studio Quality Mic",
      image: "/assets/Mic.png", // Path to image in public folder
    },
    {
      id: 6,
      name: "PS5",
      price: "$50/day",
      features: "PlayStation 5 Console",
      image: "/assets/Ps5.png", // Path to image in public folder
    },
  ];

  // Initialize the useNavigate hook for navigation
  const navigate = useNavigate();

  // Function to navigate to Rentals page
  const handleSeeMore = () => {
    navigate("/rentals");  // Redirect to the Rentals page
  };

  return (
    <section id="gadgets" className="py-20 bg-black">
      <h2 className="text-center text-4xl font-bold text-cyan-400 mb-10">
        Available Gadgets
      </h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 px-4 md:px-20">
        {gadgets.map((gadget) => (
          <div
            key={gadget.id}
            className="bg-gradient-to-br from-gray-900 via-black to-gray-800 p-6 rounded-lg shadow-lg hover:shadow-cyan-400/50 text-center text-white transition"
          >
            {/* Gadget Image */}
            <img
              src={gadget.image}
              alt={gadget.name}
              className="w-full h-48 object-contain rounded-lg mb-4" // Image styling
            />
            <h3 className="text-xl font-bold mb-2">{gadget.name}</h3>
            <p className="text-gray-400 mb-2">{gadget.features}</p>
            <p className="text-cyan-400 font-bold mb-4">{gadget.price}</p>
            <button className="px-4 py-2 bg-cyan-400 text-black rounded-md hover:bg-cyan-500 transition">
              Rent Now
            </button>
          </div>
        ))}
      </div>

      {/* "See More" button */}
      <div className="text-center mt-8">
        <button
          onClick={handleSeeMore}  // Trigger the navigation
          className="px-6 py-3 bg-cyan-400 text-black text-lg font-semibold rounded-full shadow-lg hover:shadow-cyan-400/50 hover:bg-cyan-500 transition"
        >
          See More
        </button>
      </div>
    </section>
  );
};

export default Gadgets;
